import React, { Component } from "react";
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: null
    };
  }
  componentDidMount() {
    fetch("https://form4earth-2b74.restdb.io/rest/form4earth")
      .then(response => response.json())
      .then(data => this.setState({ data }));
  }
}
export default App;
